Module PatternMatcherTests
    Sub RunTests()
        ' Test case 1: Simple 2x2 rig in 3x3 map with 1 match
        Dim rig1 As String() = {"ab", "cd"}
        Dim map1 As String() = {"abc", "cda", "efg"}
        Debug.Assert(PatternMatcher.CountPatternMatches(rig1, map1) = 1)

        ' Test case 2: 1x1 rig in 2x2 map with 4 matches
        Dim rig2 As String() = {"a"}
        Dim map2 As String() = {"aa", "aa"}
