        ' Test case 3: No matches
        Dim rig3 As String() = {"xyz"}
        Dim map3 As String() = {"abc", "def"}
        Debug.Assert(PatternMatcher.CountPatternMatches(rig3, map3) = 0)
    End Sub
End Module

