Imports System
Imports System.Collections.Generic
Imports System.Diagnostics

Module StringReplacerTests
    Sub RunTests()
        ' Test case 1
        Dim replacements1 As New Dictionary(Of String, String) From {
            {"Hello", "Hi"},
            {"world", "universe"}
        }
        Debug.Assert(ReplaceSubstrings("Hello, world!", replacements1) = "Hi, universe!")

        ' Test case 2
        Dim replacements2 As New Dictionary(Of String, String) From {
            {"quick", "slow"},
            {"brown", "red"},
            {"lazy", "energetic"}
        }
        Debug.Assert(ReplaceSubstrings("The quick brown fox jumps over the lazy dog.", replacements2) = "The slow red fox jumps over the energetic dog.")

        ' Test case 3
        Dim replacements3 As New Dictionary(Of String, String) From {
            {"is", "was"},
            {"test", "example"}
        }
        Debug.Assert(ReplaceSubstrings("This is a test.", replacements3) = "Thwas was a example.")
    End Sub
End Module
